B.OQ=new A.c_("EN QUALIT\xc9 DE MEMBRE DE LA PROFESSION M\xc9DICALE JE PRENDS L\u2019ENGAGEMENT SOLENNEL de consacrer ma vie au service de l\u2019humanit\xe9 ;\n\nJE CONSID\xc9RERAI la sant\xe9 et le bien-\xeatre de mon patient comme ma priorit\xe9 ;\n\nJE RESPECTERAI l\u2019autonomie et la dignit\xe9 de mon patient ;\n\nJE VEILLERAI au respect absolu de la vie humaine ;\n\nJE NE PERMETTRAI PAS que des consid\xe9rations d\u2019\xe2ge, de maladie ou d\u2019infirmit\xe9, de croyance, d\u2019origine ethnique, de genre, de nationalit\xe9, d\u2019affiliation politique, de race, d\u2019orientation sexuelle, de statut social ou tout autre facteur s\u2019interposent entre mon devoir et mon patient ;\n\nJE RESPECTERAI les secrets qui me seront confi\xe9s, m\xeame apr\xe8s la mort de mon patient ;\n\nJ\u2019EXERCERAI ma profession avec conscience et dignit\xe9, dans le respect des bonnes pratiques m\xe9dicales ;\n\nJE PERP\xc9TUERAI l\u2019honneur et les nobles traditions de la profession m\xe9dicale ;\n\nJE T\xc9MOIGNERAI \xe0 mes professeurs, \xe0 mes coll\xe8gues et \xe0 mes \xe9tudiants le respect et la reconnaissance qui leur sont dus ;\n\nJE PARTAGERAI mes connaissances m\xe9dicales au b\xe9n\xe9fice du patient et pour les progr\xe8s des soins de sant\xe9 ;\n\nJE VEILLERAI \xe0 ma propre sant\xe9, \xe0 mon bien-\xeatre et au maintien de ma formation afin de prodiguer des soins irr\xe9prochables ;\n\nJE N\u2019UTILISERAI PAS mes connaissances m\xe9dicales pour enfreindre les droits humains et les libert\xe9s civiques, m\xeame sous la contrainte ;\n\nJE FAIS CES PROMESSES sur mon honneur, solennellement, librement.",null,B.d4,null,null,null,null,null,null)
B.OR=new A.c_("Adopt\xe9e par la 2e Assembl\xe9e G\xe9n\xe9rale de l\u2019Association M\xe9dicale Mondiale Gen\xe8ve (Suisse), Septembre 1948 Et amend\xe9e par la 22e Assembl\xe9e M\xe9dicale Mondiale, Sydney, Australie, Ao\xfbt 1968 Et la 35e Assembl\xe9e M\xe9dicale Mondiale, Venise, Italie, Octobre 1983 Et la 46e Assembl\xe9e g\xe9n\xe9rale, Stockholm, Su\xe8de, Septembre 1994 Et r\xe9vis\xe9e par la 170e Session du Conseil, Divonne-les-Bains, France, Mai 2005 Et par la 173e Session du Conseil, Divonne-les-Bains, France, Mai 2006 Et amend\xe9e par la 68\xe8me Assembl\xe9e g\xe9n\xe9rale, Chicago, Etats-Unis, Octobre 2017 ",null,B.d4,null,null,null,null,null,null)
