B.OT=new A.c_("Il arrive qu\u2019une lettre reste sans r\xe9ponse\u2026 Que faire ? Attendez quelques temps et r\xe9\xe9crivez. Il n\u2019y a pas de mal \xe0 se faire et n\u2019oubliez pas que vous \xe9crivez \xe0 un confr\xe8re qui a le devoir de vous r\xe9pondre. \xab Je me permets de vous renvoyer ma lettre du \u2026 au cas o\xf9 vous ne l\u2019auriez pas re\xe7ue\u2026 \xbb. Ce sera une occasion pour apporter d\u2019autres pr\xe9cisions. Et si vous n\u2019obtenez pas encore de r\xe9ponse, prenez les choses du bon c\xf4t\xe9 ! Votre correspondant est probablement absent ou il n\u2019a re\xe7u aucune de vos lettres\u2026En tout cas, soyez assur\xe9 qu\u2019un bon m\xe9decin vous r\xe9pondra toujours.\nAyez du tact ! \xab Apr\xe8s les investigations, il s\u2019est av\xe9r\xe9 que l\u2019enfant R. pr\xe9sentait une m\xe9ningite\u2026 \xbb. Il n\u2019y a donc pas lieu de pr\xe9ciser que votre correspondant s\u2019est tromp\xe9 dans son diagnostic. Il n\u2019a pas les moyens d\u2019exploration que vous avez.\n\nDe m\xeame, si vous constatez qu\u2019une faute a \xe9t\xe9 commise, r\xe9parez-l\xe0 avant tout et surtout n\u2019en parlez pas au patient. Vous aussi, vous n\u2019\xeates pas \xe0 l\u2019abri d\u2019une faute ou d\u2019une ignorance. Prenez toujours la d\xe9fense de votre confr\xe8re et sachez que d\u2019autres en feront autant pour vous. Attendez une autre occasion pour lui en parler si vous y tenez vraiment. L\xe0, c\u2019est l\u2019un des rares cas o\xf9 \xe9crire une lettre n\u2019est gu\xe8re recommand\xe9.\n\nPour conclure, la correspondance m\xe9dicale nous permet de remplir nos obligations \xe9thiques,professionnelles et relationnelles. Elle a \xe9t\xe9 d\xe9laiss\xe9e depuis quelques temps mais aujourd\u2019hui, la profession souffre d\u2019une certaine d\xe9consid\xe9ration qu\u2019il est n\xe9cessaire de tout mettre en \u0153uvre pourredorer notre blason.\n",null,B.b8,null,null,null,null,null,null)
