B.OZ=new A.c_("Nadikan'ny Akademia Malagasy\n\n Amin\u2019ny maha-mpikambana ahy eo amin\u2019ny sehatry ny asa fitsaboana\n Dia manaiky an-tsitrapo eto ampahibemaso aho fa hanokana ny fiainako ho an\u2019ny mpiara-belona amiko.\n\n Hataoko ho vaindohan-draharaha ny hahatonga ny marary tsaboiko ho salama sy finaritra.\n\n Hajaiko ny fahaleovan-tena sy ny hasin\u2019ny Marary tsaboiko.\n\n Hataoko ho toy ny anakandriamaso ny fanajana feno ny ain\u2019olombelona.\n\n Tsy havelako ho sakana tsy hahatontosa ny adidiko amin\u2019ny marary tsaboiko ny taonany, ny aretiny na ny kilemany, ny finoany, ny fiaviany, ny maha-lahy na maha-vavy azy, ny fireneny, ny antoko politika misy azy, ny volon-kodiny, ny firehany amin\u2019ny filana ara-nofo, ny sarangam-piaraha-monina misy azy , na zavatra hafa ankoatra izany\n Hajaiko ny tsiambaratelo naboraka tamiko na aorian\u2019ny fahafatesan\u2019ny marary notsaboiko aza.\n\n Hataoko am-pihainoana ny feon\u2019ny fieritreretana sy amim-pahamendrehana ny asako, araka ny fenitra takin\u2019ny asa fitsaboana Hitozo hanaja sy hanome lanja ny soatoavina nifandov\xe0na teo amin\u2019ny asa fitsaboana aho.\n\n Haneho fanajana sy fankasitrahana izay mendrika ho an\u2019ireo mpampianatra ahy, ireo mpiara-miasa amiko ary ireo mpianatro aho.\n\n Hizara ny fahalalana ananako momba ny fitsaboana amin\u2019ny hafa aho, ho tombontsoan\u2019ny marary sy ho fampivoarana ny fomba fikajiana ny fahasalamana.\n\n Hitandrina ny tenako ho salama tsara sy ho finaritra aho ary hampitombo hatrany ny fahalalako mba hahazoana manome fitsaboana avolenta.\n\n Tsy hampiasaiko hanitsakitsahana ny zo mahaolona sy ny fahalalahan\u2019ny olom-pirenena ny fahaizana ananako amin\u2019ny fitsaboana na dia terena aza aho.\n\n Mianiana am-pahibemaso sy an-kalalahana aho fa hotanterahiko ireo fanomezan-toky ataoko ireo.",null,B.b8,null,null,null,null,null,null)
