B.P1=new A.c_("La mise \xe0 jour des connaissances est une obligation pour tout M\xe9decin. Con\xe7ue sous forme de mod\xe8les th\xe9rapeutiques, cette brochure est r\xe9serv\xe9e \xe0 l\u2019usage des seuls m\xe9decins. Elle compl\xe8te et remplace l'\xe9dition de 2019 et se veut \xeatre pratique et claire malgr\xe9 son volume r\xe9duit. Elle pr\xe9sente une synth\xe8se des recommandations th\xe9rapeutiques de la Haute Autorit\xe9 de la Sant\xe9 (HAS), de l'ANSM, des Soci\xe9t\xe9s savantes. Notre v\u0153u est que cet outil de prescription vous rende service dans votre pratique quotidienne. Il se peut que des erreurs s\u2019y soient gliss\xe9es malgr\xe9 la rigueur de sa r\xe9alisation. Nous d\xe9clinons toute responsabilit\xe9 quant aux cons\xe9quences qui pourraient en r\xe9sulter. Merci \xe0 tous ceux qui ont contribu\xe9 \xe0 ce travail.\n\nConfraternellement,\n\nDr Eric ANDRIANASOLO Pr\xe9sident du Conseil national de l\u2019Ordre des M\xe9decins",null,B.b8,null,null,null,null,null,null)
B.P2=new A.c_('\tLa correspondance m\xe9dicale a une place importance dans notre pratique quotidienne. Bien \xe9crire permet de maintenir une bonne relation de confraternit\xe9. Voici quelques formules d\u2019introduction qui serviront surtout \xe0 nos jeunes confr\xe8res.\n\nHabituellement, introduire une lettre par "Cher Confr\xe8re," ou "Ch\xe8re Cons\u0153ur,".\n\n\xab Docteur, \xbb est aussi poli sinon, \xab Monsieur \xbb et \xab Madame \xbb restent convenables si vous ne connaissez ni le rang ni l\u2019\xe2ge de votre correspondant.\n\nA un professeur qui vous a enseign\xe9, pr\xe9f\xe9rer \xab Cher Ma\xeetre \xbb. S\u2019il ne vous a pas enseign\xe9, choisissez \xab Monsieur le Professeur \xbb.\n\n\xab Cher Ami \xbb ou \xab Ch\xe8re Amie \xbb est plut\xf4t utilis\xe9 par un enseignant pour \xe9crire \xe0 son \xe9l\xe8ve. S\u2019il ne s\u2019agit pas de son \xe9l\xe8ve, le professeur aura \xe0 mettre \xab Docteur, \xbb ou \xab Cher Confr\xe8re \xbb d\u2019autant plus qu\u2019il s\u2019agisse d\u2019un m\xe9decin plus \xe2g\xe9 que lui.\n \xab Cher Ami \xbb peut aussi \xeatre utilis\xe9 entre coll\xe8gues qui se connaissent tr\xe8s bien mais il ne faut surtout pas y voir une certaine impertinence. \xab Cher Coll\xe8gue \xbb est \xe9videmment r\xe9serv\xe9 \xe0 ceux qui travaillent ou ont travaill\xe9 ensemble.\n\nSurtout \xe9viter les \xab Cher Jules \xbb, \xab Cher Professeur \xbb et autres \xab Cher Docteur \xbb.\n\nPour une correspondance par courriel, vous pouvez commencer par un \xab bonjour, \xbb si la personne avec qui vous correspondez vous est assez famili\xe8re. Plus simple encore, le pr\xe9nom peut \xeatre utilis\xe9 entre amis : \xab Jules, bonjour. Je te prie de\u2026 \xbb mais il vaut mieux s\u2019en abstenir si la personne est plus \xe2g\xe9e que vous. Enfin, si vous devez citer la personne, mettez son nom apr\xe8s son titre mais jamais son pr\xe9nom. (Ex : Dr RAKOTOSALAMA et non Dr Jules).\n\nIl faut admettre que nous correspondons dans une langue qui n\u2019est pas la n\xf4tre et dont nous ne ma\xeetrisons pas toutes les subtilit\xe9s. Aussi est-il plus qu\u2019important de respecter ces quelques r\xe8gles\n\n ',null,B.b8,null,null,null,null,null,null)
